import mongoose from 'mongoose';

const MealSchema = mongoose.Schema({
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'users'
  }
  //   date: {
  //     type: Date,
  //     default: Date.now
  //   }
});

export default mongoose.model('movies', MealSchema);
